// UserLogin.jsx
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom'; // Import Link and useNavigate
import AuthService from '../../services/AuthService';
import { useAuth } from '../../context/AuthContext';
import '../../styles/UserLogin.css';

function UserLogin() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate();
  const { login } = useAuth();

  async function loginUser(event) {
    event.preventDefault();
    let userRequest = {
      email: email,
      password: password,
    };

    try {
      AuthService.authenticateUser(userRequest).then((res) => {
        if (res.data.message === "Email not exists") {
          alert("Email not exists");
        } else if (res.data.message === "Login Success") {
          alert("Login success");
          login(res.data.user.user_id, res.data.token, res.data.user.role);
          if (res.data.user.role === 'ROLE_ADMIN') {
            navigate('/admin-home');
          } else if (res.data.user.role === 'ROLE_USER') {
            navigate('/user-home');
          } else {
            // Handle other roles as needed
            alert("Unsupported role: ");
          }
        } else {
          alert("Incorrect Email and Password not match");
        }
      });
    } catch (err) {
      alert(err);
    }
  }

  return (
    <div className="login-container">
      <div className="container">
        <div className="row">
          <div className="col-sm-6 mx-auto">
            <form className="login-form">
              <h2>Login</h2>
              <hr />

              <div className="form-group">
                <label>Email</label>
                <input
                  type="email"
                  className="form-control"
                  id="email"
                  placeholder="Enter Email"
                  value={email}
                  onChange={(event) => setEmail(event.target.value)}
                />
              </div>

              <div className="form-group">
                <label>Password</label>
                <input
                  type="password"
                  className="form-control"
                  id="password"
                  placeholder="Enter Password"
                  value={password}
                  onChange={(event) => setPassword(event.target.value)}
                />
              </div>

              <button
                type="submit"
                className="btn btn-primary btn-block"
                onClick={loginUser}
              >
                Login
              </button>
            </form>

          </div>
        </div>

      </div>
    </div>
  );
}

export default UserLogin;
